### Réponse : "A"

Lorsque l’on consomme trop d’alcool, on peut développer une intoxication alcoolique qui peut conduire à un empoisonnement par l’alcool. L’intoxication alcoolique est caractérisée par des symptômes tels que :

- La désorientation ;
- La miction fréquente ;
- La mauvaise haleine ;
- Des troubles de la vision ;
- Des troubles de l’équilibre ;
- Des douleurs abdominales ;
- Des nausées et vomissements ;
- Des convulsions ;
- Une hypotension (baisse du taux de pression artérielle) ;
- Une hypoglycémie (baisse du taux de sucre dans le sang) ;
- Une hyperthermie (élévation du taux de température corporelle). 

L’intoxication alcoolique peut être grave et nécessiter une hospitalisation en cas de surdosage ou d’intoxication aiguë. En cas d’intoxication chronique, elle peut conduire à des complications graves telles que : 
- La cirrhose (détruction du foie) ; 
- La maladie du foie non alcoolique (hépatite) ; 
- La maladie du foie alcoolique (hépatite alcoolique) ; 
- La maladie cardiaque (détruction du cœur) ; 
- La maladie pulmonaire (détruction des poumons) ; 
- La dépression (trouble mental).
